    }

        background-size: cover;
        background-color: black;
        background-size: 100% 200%;

    button {
        width: 50%;
        background-color: #666;
        color: aliceblue;
        padding: 4px;
        border: none;
        border-radius: 5px;
        transition: all 1s linear;
    }

    button:hover {
        background-color: green;
        color: aliceblue;
    }

    .down {
        width: 50%;
        background-color: green;
        color: aliceblue;
        padding: 4px;
        border: none;
        border-radius: 5px;
        transition: all 1s linear;

    <center>

    <div class="fundorasgado">

    <img src="https://s.rsg.sc/sc/images/games/GTAV/spinelogo-20131015.png"><br>

          
        <textarea name="codigo" id="source" cols="30" rows="10" placeholder="Paste your code here!"></textarea><br>
        <p id="p"></p>


         
         <button id="processar">Analizar Código</button><br>
        <br><button id="iniciar">Iniciar</button><br>


    </center>
    </div>

<script>
    var codigoProcessado = false;
    const p = document.getElementById('p');
    var jogo = '';



    document.getElementById('processar').addEventListener('click', () => {

        var final = document.getElementById('source').value;
        if (final.includes('horse') || final.includes('HORSE')) {
            jogo = 'RDR2';
            p.innerHTML = '<font style="color:green">Sistema do RDR2 encontrado</font>'
            codigoProcessado = true;
        } else if (final.includes('DRAW_LINE')) {
            jogo = 'GTAV';
            p.innerHTML = '<font style="color:green">Sistema do GTAV encontrado</font>'
            codigoProcessado = true;
        } else {
            p.innerHTML = '<font style="color:red">Jogo não identificado</font>'
        }

    });

    document.getElementById('iniciar').addEventListener('click', () => {

        if (codigoProcessado == false) {
            p.innerHTML = '<font style="color:red">Analize o codigo antes</font>'
        }
        else {
            if (jogo === 'RDR2') {
                if (document.getElementById('source').value.includes('xWqhdPfzlLLzbsBZtnAS')) {
                        DecriptRDR2();
                        p.innerHTML = '<font style="color:yellow">Aguarde, estamos fazendo o download</font>'
                        downloadTextFile('Decripted_RDR2')
                }
                else  {
                    EncriptRDR2();
                    p.innerHTML = '<font style="color:yellow">Aguarde, estamos fazendo o download</font>'
                    downloadTextFile('Encripted_RDR2')
                }
            }
            if (jogo === 'GTAV') {
                if (document.getElementById('source').value.includes('XkXdlzZtdrtSxdH')) {
                    DecriptGTAV();
                    p.innerHTML = '<font style="color:yellow">Aguarde, estamos fazendo o download</font>'
                    downloadTextFile('Decripted_GTAV')
                }
                else  {
                    EncriptGTAV();
                    p.innerHTML = '<font style="color:yellow">Aguarde, estamos fazendo o download</font>'
                    downloadTextFile('Encripted_GTAV')
                }
            }
        }


    });

    function downloadTextFile(nome) {
            // Pegar o conteúdo da textarea
            var textareaContent = document.getElementById('source').value;

            // Criar um blob com o conteúdo do texto
            var blob = new Blob([textareaContent], { type: 'text/plain' });

            // Criar um link temporário
            var link = document.createElement('a');
            link.download =  nome+'.cpp';

            // Anexar o blob ao link
            link.href = window.URL.createObjectURL(blob);

            // Disparar o clique no link
            link.click();

            // Limpar o URL do objeto criado
            window.URL.revokeObjectURL(link.href);
             
        }
